String toValidStr(String s) => s.toLowerCase().replaceAll("_", " ").replaceAll(RegExp(r"\D"), "");

int compare(Map<String, Map<String, double>> map, String r, String e1, String e2) {
  try {
    return map[r]![e1]!.compareTo(map[r]![e2]!);
  } catch (e) {
    return 0;
  }
}

List<String> getRecommended(Set<String> input, Set<String> visited) {
  if (input.length < 3) {
    return ["-", "-", "-"];
  }

  String r = visited.toList()[rnd.nextInt(visited.length)];
  List<String> left = input.difference(visited).toList();
  left.sort((e1, e2) => compare(map, toValidStr(r), toValidStr(e1), toValidStr(e2)));
  return [left[0], left[1], left[2]];
}
